import React ,{Component} from 'react';
import Header from './Header';
import StickyNavBar from './StickyNavBar';
import './Registry.css';

const img = require("../res/om_registry.jpg");
const store_names = ['amazon', 'target'];
class Registry extends Component{

    render(){
        const stores_div = store_names.map((key,store)=>{
            return(
                <div key={key} className='store-container'>
                    <img src={`${require('../res/'+store+'.jpg')}`}></img>
                </div>    
            )

        })
        return(

            <div id='Registry'>
                <Header/>
                <StickyNavBar/>
                <span className='capture'>We are strting small!</span>
                <span className='registry-capture-small'>And hope you could help us :)</span>
                <div className='registry-img background-tint' style={{'backgroundImage':`url('${img}')`}}/>
                <div className='registry-pane'>
                    <span> Here are a few stores we registred wtih:</span>

                </div>


            </div>
        )
    }


}
export default Registry;
